import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, SafeAreaView, FlatList } from "react-native";

export default function App() {
  return (
    <SafeAreaView style={styles.body}>
      <View style={styles.container}>
        <h1>Aplikacja Ratowników Mazowsza</h1>
        <FlatListBasics></FlatListBasics>
        <View>
          <button onClick={basicFunction}>
            <Text>Naciśnij mnie</Text>
          </button>
        </View>
        <StatusBar style="auto" />
      </View>
    </SafeAreaView>
  );
}

function basicFunction() {
  console.log("abc");
}

const FlatListBasics = () => {
  return (
    <View style={styles.users}>
      <FlatList
        data={[
          { key: "Jan", isAvailable: true },
          { key: "Daniel", isAvailable: false },
          { key: "Dominik", isAvailable: true },
          { key: "Jerzy", isAvailable: false },
          { key: "Adam", isAvailable: true },
        ]}
        renderItem={({ item, isAvailable }) => (
          <View>
            {item.isAvailable == true ? (
              <Text>
                {item.key} - <Text style={styles.available}>Dostępny</Text>
              </Text>
            ) : (
              <Text>
                {item.key} - <Text style={styles.unavailable}>Niedostępny</Text>
              </Text>
            )}
          </View>
        )}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  body: {
    width: "50%",
    height: "90%",
    borderColor: "red",
    borderWidth: "2px",
    borderRadius: "5px",
    marginLeft: "auto",
    marginRight: "auto",
    backgroundColor: "lightblue",
    flex: 1,
  },
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  users: {
    marginBottom: "20px",
  },
  available: {
    color: "darkgreen",
  },
  unavailable: {
    color: "darkred",
  },
});
